import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import Main from './views/Main';
import OneCigar from './components/OneCigar';
import CigarCard from './components/CigarCard';

function App() {


  return (
    <BrowserRouter>

      <div className="App">

        <Routes>
          <Route path='/' element={<Main />}/>
          <Route parth='edit/id' element={<CigarCard />} />
          <Route path='/cigar' element={<OneCigar />}/>
        </Routes>

      </div>

    </BrowserRouter>

  );
}

export default App;
